import React from 'react';
import { ThemeConsumer } from 'react-bootstrap/esm/ThemeProvider';

const Home = (props) => {
    return(
        <div className="main">
            <div id="header">
                {/* This is where the header profile image will go */}
                <img src="https://e-ga.com.au/cms/wp-content/uploads/2014/03/josh-profile-img1-300x300.jpg" />
            </div>
        </div>
    )
}

export default Home;
